  Column
}
from "./components";

class App extends Component {
  render() {
    return (
      <Row>
        <Column>
          <Grid>
            <Button name="q"/>
            <Button name="w"/>
            <Button name="e"/>

            <Button name="a"/>
            <Button name="s"/>
            <Button name="d"/>

            <Button name="z"/>
            <Button name="x"/>
            <Button name="c"/>
          </Grid>
        </Column>

        <Column>
          <h1> asdasd </h1>
          <div className="form-group">
            <label for="formControlRange">Example Range input</label>
            <input type="range" className="form-control-range" id="formControlRange"/>
          </div>
        </Column>
      </Row>
    );
  }
}

export default App;
